		"text": "\"관리의 수가 놀라울 만큼 적다는 점입니다. 전라도와 제주도를 통치한 관리의 수가 100여 명에 불과할 정도였어요. 서울을 제외하면 조선 8도를 통치한 일선 관리의 숫자는 1000명이 채 안 됩니다. 소수의 관리들이 국가 살림을 이끌어 간 것이죠.\""
