		"text": "@k4partisan 천황가도 존속했는데요 뭘. 어쨌거나 덕치라는 명목의 신분질서는 안정적이었고 국가체제는 지주의 권익을 보장하는 선에서만 있었던 거겠죠. 이왕가도 하나의 지주 가문이었다고 봐야 여러모로 설명 가능해지는 구석이 많은 듯해요."
